import React from "react";
import {
  //   useGetData,
  usePostData,
  //   useEditData,
  //   useDeleteData,
} from "../../../axios/hooks";
import { Button, Modal } from "antd";
import { useState } from "react";
import "antd/dist/reset.css";
import { PlusOutlined } from "@ant-design/icons";
import {
  Cascader,
  Checkbox,
  DatePicker,
  Form,
  Input,
  InputNumber,
  Radio,
  Select,
  Switch,
  TreeSelect,
  Upload,
} from "antd";
const { RangePicker } = DatePicker;
const { TextArea } = Input;

export default function PostProduct() {
  const post = usePostData("/products");
  const [componentDisabled, setComponentDisabled] = useState(false);
  const data = {
    type: "max",
    active: true,
    size: "13.3",
    gender: "BOTH",
    color: "gray",
    name_Ru: "мaк",
    name_Uz: "mac",
    name_En: "Mac",
    price: 1199.99,
    discount: 10,
    description_Uz: "makbook air",
    description_Ru: "макбук эйр",
    description_En: "MacBook air",
    categoryId: "016fc031-2174-4cac-a6fd-98a29d141745",
    photoId: "873647384732463976t4",
  };

  const postData = () => {
    post.mutate(data, {
      onSuccess: (post) => console.log(post, "data"),
      onError: (error) => console.log(error, "error"),
    });
  };

  //   if (isLoading) {
  //     return <p>isLoading</p>;
  //   }
  //   if (isError) {
  //     return <p>error check your internet</p>;
  //   }
  const [open, setOpen] = useState(false);
  return (
    <div>
      <>
        <Button type="primary" onClick={() => setOpen(true)}>
          Create post
        </Button>
        <Modal
          title="Create post"
          centered
          open={open}
          onOk={() => setOpen(false)}
          onCancel={() => setOpen(false)}
          width={1000}
        >
          <>
            {/* <Checkbox
              checked={componentDisabled}
              onChange={(e) => setComponentDisabled(e.target.checked)}
            >
              Form disabled
            </Checkbox> */}
            <Form
              onSubmit={() => {
                console.log("clicked");
              }}
              labelCol={{
                span: 4,
              }}
              wrapperCol={{
                span: 14,
              }}
              layout="horizontal"
              disabled={componentDisabled}
              style={{
                maxWidth: 600,
              }}
            >
              <Form.Item
                label="Checkbox"
                name="disabled"
                valuePropName="checked"
              >
                <Checkbox>Checkbox</Checkbox>
              </Form.Item>
              <Form.Item label="Radio">
                <Radio.Group>
                  <Radio value="apple"> Apple </Radio>
                  <Radio value="pear"> Pear </Radio>
                </Radio.Group>
              </Form.Item>
              <Form.Item label="Input">
                <Input />
              </Form.Item>
              <Form.Item label="Select">
                <Select>
                  <Select.Option value="demo">Demo</Select.Option>
                </Select>
              </Form.Item>
              <Form.Item label="TreeSelect">
                <TreeSelect
                  treeData={[
                    {
                      title: "Light",
                      value: "light",
                      children: [
                        {
                          title: "Bamboo",
                          value: "bamboo",
                        },
                      ],
                    },
                  ]}
                />
              </Form.Item>
              <Form.Item label="Cascader">
                <Cascader
                  options={[
                    {
                      value: "zhejiang",
                      label: "Zhejiang",
                      children: [
                        {
                          value: "hangzhou",
                          label: "Hangzhou",
                        },
                      ],
                    },
                  ]}
                />
              </Form.Item>
              <Form.Item label="DatePicker">
                <DatePicker />
              </Form.Item>
              <Form.Item label="RangePicker">
                <RangePicker />
              </Form.Item>
              <Form.Item label="InputNumber">
                <InputNumber />
              </Form.Item>
              <Form.Item label="TextArea">
                <TextArea rows={4} />
              </Form.Item>
              <Form.Item label="Switch" valuePropName="checked">
                <Switch />
              </Form.Item>
              <Form.Item label="Upload" valuePropName="fileList">
                <Upload action="/upload.do" listType="picture-card">
                  <div>
                    <PlusOutlined />
                    <div
                      style={{
                        marginTop: 8,
                      }}
                    >
                      Upload
                    </div>
                  </div>
                </Upload>
              </Form.Item>
              <Form.Item label="Button">
                <Button
                  type="submit"
                  onClick={() => {
                    console.log(123);
                  }}
                >
                  Button
                </Button>
              </Form.Item>
            </Form>
          </>
        </Modal>
      </>
      {/* <button onClick={() => postData()}>create post</button> */}
    </div>
  );
}
